  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kodiak
  NWR outlines Refuge accomplishments during the 1990 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, public participation, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, volunteer programs, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wilderness
  areas. The wildlife section of the report discusses waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, marine mammals, and fisheries resources. The
  public uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, fishing, trapping, and law enforcement. The equipment and facilities section
  of the report provides information about rehabilitation, equipment replacement,
  communication systems, and computer systems. Cooperative programs and items of interest
  are provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
